import AnswerItem from "./AnswerItem";
import { Answer } from "../types";

const AnswersList = (data: any) => {
  const answers = data.answers;
  return (
    <div>
      <ul>
          {answers.map((answer: Answer) => {
            <li key={answer.id}>
              <AnswerItem answer={answer} />;
            </li>
          })}
      </ul>
    </div>
  );
};

export default AnswersList;
